import React from 'react';
import { NavLink } from 'react-router-dom';

const Navigation = () => {
    return (
        <div className='Navigation'>
            <NavLink exact to="/">
                accueil
            </NavLink>
            <NavLink exact to="/About">
                A propos
            </NavLink>


        </div>
    );
};

export default Navigation ;
